import React from 'react';
import BlogPostList from "./BlogPostList";

class BlogPostListContainer extends React.Component{
    constructor(props) {
        super(props);

        console.log(props);

        this.posts = [
            {
                id: 1,
                title: 'Post 1'
            },
            {
                id: 2,
                title: 'Post 2'
            },
            {
                id: 3,
                title: 'Post 3'
            }
        ];
    }

    render() {
        return (<BlogPostList posts={this.posts} />)
    }
}

export default BlogPostListContainer;
